import React, { Component } from 'react';
import Navbar from './Component/navbar';
import './App.css';
import Counters from './Component/Counters';


class App extends Component {
  render() {
    return (
      <React.Fragment>
        <Navbar />
        <main className="container tc">
          <Counters />
        </main>
      </React.Fragment>

    );
  }
}

export default App;
